import React from 'react'
 const Home=()=>{
     return(
        <div class="dropdown">
        <button class="dropbtn">Dropdown</button>
        <div class="dropdown-content">
        <a href="/list">Link 1</a>
        <a href="/">Link 2</a>
        <a href="/login">Link 3</a>
        </div>
      </div>
     );
 }
 export default Home;
